import { PRO_LIST } from '../actions/ActionsTypes';

export const initialState = {
    data: []
};

const product = (state = initialState, action: any) => {
    switch (action.type) {
        case PRO_LIST:
            let data = action.payload;
            console.log(data, 'action');
            return { ...state, ...data }
        default:
            return state;
    }
};
export default product;
